      <text id="62" justification="0" size="4" underlined="false">
        <text>* Customer is shown product&apos;s images, sizes, colors and price with actual price.

* Customer selects available sizes and/or colors from combobox.
* Customer clicks the Buy link/button.
* Selected product detail is shown on the next page.
* Customer clicks the Add To Cart.
* Selected product is added into the customer -session- cart.
* Cart is a temporary session object.  It is created upon the connected customer&apos;s first add to card request.  And deleted after end of the customer session.
* Customer clicks the Buy Now link/button.
* Order page is shown at the next page.
* All product in the it&apos;s cart and the last product that selected by click Buy Now are listed.
* Customer selects the products which wants to buy.
* Customer clicks the Proceed To Checkout button/link.
* A new Buy Product page is opened.</text>
